import React, { useState } from 'react';
import axios from 'axios';

const ApiTester: React.FC = () => {
    const [email, setEmail] = useState('');
    const [wordId, setWordId] = useState('');
    const [testId, setTestId] = useState('');
    const [newSchoolId, setNewSchoolId] = useState('');
    const [result, setResult] = useState<any>(null);

    const fetchUserDetails = async () => {
        try {
            const response = await axios.get('/api/User', { params: { Email: email } });
            setResult(response.data);
        } catch (error) {
            console.error('Error fetching user details:', error);
        }
    };

    const fetchWordDetails = async () => {
        try {
            const response = await axios.get('/api/Word', { params: { WordId: wordId, TestId: testId } });
            setResult(response.data);
        } catch (error) {
            console.error('Error fetching word details:', error);
        }
    };

    const createUser = async () => {
        try {
            const response = await axios.post('/api/User/new', {
                Email: email, Password: 'password123', FirebaseUID: 'someUID',
                Username: 'newuser', FirstName: 'New', LastName: 'User', JoinedTime: new Date().toISOString(), TargetSchoolId: 1
            });
            setResult(response.data);
        } catch (error) {
            console.error('Error creating user:', error);
        }
    };

    const modifyUserSchool = async () => {
        try {
            const response = await axios.post('/api/User/modify', { Email: email, TargetSchoolId: newSchoolId });
            setResult(response.data);
        } catch (error) {
            console.error('Error modifying user school:', error);
        }
    };

    return (
        <div>
            <h2>API Tester Component</h2>
            <div>
                <input type="text" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="Enter email" />
                <button onClick={fetchUserDetails}>Fetch User Details</button>
                <button onClick={createUser}>Create User</button>
                <button onClick={modifyUserSchool}>Modify User School</button>
                <input type="text" value={newSchoolId} onChange={(e) => setNewSchoolId(e.target.value)} placeholder="New School ID" />
            </div>
            <div>
                <input type="text" value={wordId} onChange={(e) => setWordId(e.target.value)} placeholder="Word ID" />
                <input type="text" value={testId} onChange={(e) => setTestId(e.target.value)} placeholder="Test ID" />
                <button onClick={fetchWordDetails}>Fetch Word Details</button>
            </div>
            <div>
                <h3>Results:</h3>
                <pre>{JSON.stringify(result, null, 2)}</pre>
            </div>
        </div>
    );
};

export default ApiTester;
